import React from "react";
import { Container, Col, Row, Badge, Card } from "react-bootstrap";
import Typewriter from "typewriter-effect";

const viewData = {};
const genreData = {};
const timeData = {};
const popularityData = {};

const Sample = () => {
  return (
    <Container className="text-center">
      <Container className="text-center" style={{ height: "100vh" }}>
        <h1 className="netflix-red">
          Your Netflix Analysis <Badge variant="warning">Example</Badge>
        </h1>
        <Row className="justify-content-center">
          <Col>
            <Typewriter
              onInit={(typewriter) => {
                typewriter
                  .typeString("Analyzing your fake data...")
                  .pauseFor(2500)
                  .deleteAll()
                  .typeString("Generating your fake score...")
                  .pauseFor(2500)
                  .deleteAll()
                  .typeString("Done. Here is your score")
                  .start();
              }}
              options={{
                deleteSpeed: 20,
              }}
            />
          </Col>
        </Row>
      </Container>
      <h2>Your score was 30 !</h2>
      <Container className="text-center">
        <Card className="text-dark mb-2">
          <Card.Title>Top Views</Card.Title>
        </Card>
        <Card className="text-dark mb-2">
          <Card.Title>Top Genre</Card.Title>
        </Card>
        <Card className="text-dark mb-2">
          <Card.Title>View Time</Card.Title>
        </Card>
        <Card className="text-dark mb-2">
          <Card.Title>Popularity</Card.Title>
        </Card>
      </Container>
    </Container>
  );
};

export default Sample;
